import React from "react";

function About() {
  return (
    <div className="page"> {/* <-- ADDED: Class for styling */}
      <h1>About Me</h1>
      <p>Welcome to my personal website! I am Kendall Burkett, a data analyst with a strong background in analytics, visualization, and machine learning.</p>
      <p>My goal is to turn data into actionable insights and make informed business decisions.</p>
    </div>
  );
}

export default About;
